import React from 'react';
import { Container, Row, Col } from 'reactstrap';

const NotFound = () => {
    return(
       <div>
           <Container>
               <Row><br /><br /></Row>
               <Row>
                    <h1 style={{color: "red", textAlign:"center"}}>You Are not Authorized to View this Page!</h1>
               </Row>
            </Container>    
       </div>
    )
}

export default NotFound;
